/**
 * @author Rafal Cymbalsita
 * @class ProjectsStatus
 * @static
 * @property {String} status
 */
export default class ProjectDeliveryType {
   /**
    * @constructor
    * @param {String} status
    */
   constructor(deliveryType) {
      this.deliveryType = deliveryType;
   }
   /**
    * @public
    * @returns {ProjectStatus}
    */
   getProjectDeliveryTypeDTO() {
      return {
         deliveryType: {
            deliveryType: this.deliveryType
         }
      };
   }
}
